import React from 'react'

function Dolls() {
  const [data, setData] = useState()

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'dolls'
      )
      setData(result.data)
      console.log(result.data)
    } 
    fetchData()
  }, [])
  return (
    <div>
      these are dolls
    </div>
  )
}

export default Dolls
